import { useState } from "react"

export function ChatsGenerate(){
const [users,setUsers]=useState("")

    fetch(`https://localhost:44317/api/Cseveges/${JSON.parse(localStorage.getItem("user")).Felhasznalonev}`)
    .then(response=>{
        return response.json()
    })
    .then(data=>{
        var chat=[]
        data.forEach((adat) => {
            chat.push(
                <li>
                    <div>
                        <h2>{adat.Felhasznalonev}</h2>

                    </div>
                </li>)
        })
        setUsers(chat)
        /*                        <h3>
                            {adat.Last_Message} {adat.Time}
                        </h3> */
    })
    return users
}
